import React from "react";

// import "./App.css";

function App() {
  return (
    <>
      <div className="main_div">
        <div className="center_div">
          <br />
          <h1>ToDo List</h1>
          <br />
          <input type="text" id="task" name="task" placeholder="Enter a Id" />
        </div>
      </div>
    </>
  );
}

export default App;
